import logo from './logo.svg';
import './App.css';


const Product = (prods) => {
  return(
    <>
    <h1>{prods.name}</h1>
    <p>{prods.description}</p>
    <image src={prods.image}></image>
    </>
  )
}

function App() {
  return (
    <div className="App">
      <h1>Hello World. </h1>
      <Product name={'Strawberry Dango'} description={'Tastes great'} image={'media/strawberrydango.jpg'}/>
    </div>
  );
}

export default App;
